#!/bin/bash

tmpsql=$(mktemp)
cat <<EOF > $tmpsql
create table image (tag varchar(128), image bytea);
insert into image(tag, image) values ('openshift', '');
insert into image(tag, image) values ('soltysh', '');
insert into image(tag, image) values ('pyconpl', '');
EOF

PGPASSWORD=$4 psql -h $1 -p $2 -U $3 -d blast_image -f $tmpsql

rm $tmpsql
